import React, { Component } from 'react'

export default class Project2 extends Component {
    render() {
        return (
            <section id="spexor">
          <h2>Bosch spexor</h2>
          <div>This project was developed as part of my bachelor's thesis in cooperation with the Robert Bosch start-up spexor. </div>

          <div>Role: Researcher, Designer &amp; Developer</div>
          </section>
        )
    }
}
